import Link from "next/link";
import Layout from "../components/layout";

export default () => (
    <Layout>
        <h1>About</h1>
        <Link href="/">
            <a>Go to home</a>
        </Link>
        <p>A javascript program.</p>
        <img src="/static/javascript-logo.jpg" alt="javascript" height="200px" />
    </Layout>
);
